CREATE DATABASE shop_reviews;

USE shop_reviews;

create table users (
	id INT,
	username VARCHAR(50),
	img_url VARCHAR(100)
);

create table shops (
	id INT,
	shop VARCHAR(50)
);

create table products (
	id INT,
	product VARCHAR(50),
	img_url VARCHAR(100),
	shop_id INT
);

create table reviews (
	id INT,
	product_id INT,
	shop_id INT,
	review TEXT,
	date_submitted VARCHAR(15),
	rating INT,
	votes INT,
	helpfulness INT
);
